Rules.InvariantScript:
Switch(
    varUserLevel,
    "USER",
    ForAll(
        Notify_gal.AllItems As MyPatch,
        Patch(
            NotificationList_CertificationApp,
            {ID: MyPatch.ID},
            {
                Title: MyPatch.Title,
                UserDeleted: true
            }
        )
    ),
    "ADMIN",
    ForAll(
        Notify_gal.AllItems As MyPatch,
        Patch(
            NotificationList_CertificationApp,
            {ID: MyPatch.ID},
            {
                Title: MyPatch.Title,
                ManagerDeleted:true
            }
        )
    ),
    "SUPER-ADMIN",
    ForAll(
        Notify_gal.AllItems As MyPatch,
        Patch(
            NotificationList_CertificationApp,
            {ID: MyPatch.ID},
            {
                Title: MyPatch.Title,
                AdminDeleted: true
            }
        )
    )
);
Clear(col_Notification);
Clear(mngr_notify_Col);
